import React, { Component } from 'react'
import GoogleLogin from 'react-google-login'
import $ from "jquery";
import './Insurance.css';

export class Insurance extends Component {
    state = {
        response: '',
        name: '',
        email: '',
        password: '',
        responseToPost: '',
    };

    handleSubmit = async e => {
        e.preventDefault();
        const response = await fetch('/Auth/login', {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json',
            },
            body: JSON.stringify({ password: this.state.password, email: this.state.email, name: this.state.name }),
        });
        const body = await response.text();
        this.setState({ responseToPost: body });
    };


    // document.getElementById('.img-btn').addEventListener('click', function()
    // 	{
    // 		document.getElementById('.cont').classList.toggle('s-signup')
    // 	}
    // );
    componentDidMount() {
        $('.img-btn').click(function () {
            $('.cont').toggleClass('s-signup');
        });
    }

    responseGoogle = (response) => {
        console.log(response);
        console.log(response.profileObj);
    }
    render() {
        return (
            <div className="container">
                <div className="cont">
                    <form className="form" >
                        <h2> New Insurance</h2>
                        <div className="row">
                            <div className="col-sm-4">
                                <label >
                                    <span>Social number</span>
                                    <input type="text" name="name"
                                        // placeholder="email@gmail.com"
                                        value={this.state.name}
                                        onChange={e => this.setState({ name: e.target.value })}
                                    />
                                </label>
                                <label >
                                    <span>First name</span>
                                    <input type="text" name="name"
                                        // placeholder="email@gmail.com"
                                        value={this.state.name}
                                        onChange={e => this.setState({ name: e.target.value })}
                                    />
                                </label>
                                <label >
                                    <span>Phone number</span>
                                    <input type="text" name="name"
                                        // placeholder="email@gmail.com"
                                        value={this.state.name}
                                        onChange={e => this.setState({ name: e.target.value })}
                                    />
                                </label>

                            </div>
                            <div className="col-sm-4">
                                <label >
                                    <span>Last name</span>
                                    <input type="text" name="name"
                                        // placeholder="email@gmail.com"
                                        value={this.state.name}
                                        onChange={e => this.setState({ name: e.target.value })}
                                    />
                                </label>
                                <label >
                                    <span>Email Address</span>
                                    <input type="text" name="name"
                                        // placeholder="email@gmail.com"
                                        value={this.state.name}
                                        onChange={e => this.setState({ name: e.target.value })}
                                    />
                                </label>
                                <label >
                                    <span>Insurance Amount</span>
                                    <input type="text" name="name"
                                        // placeholder="email@gmail.com"
                                        value={this.state.name}
                                        onChange={e => this.setState({ name: e.target.value })}
                                    />
                                </label>
                            </div>
                        </div>
                        <label >
                            <span>Previous insurance number</span>
                            <input type="text" name="name"
                                // placeholder="email@gmail.com"
                                value={this.state.name}
                                onChange={e => this.setState({ name: e.target.value })}
                            />
                        </label>
                        <label>
                            <span>Previous insurance id</span>
                            <input type="email" name="email"
                                // placeholder="email@gmail.com"
                                value={this.state.email}
                                onChange={e => this.setState({ email: e.target.value })}
                            />
                        </label>
                        <label>
                            <span> Previous insurance company </span>
                            <input type="password"
                                value={this.state.password}
                                onChange={e => this.setState({ password: e.target.value })}
                            />
                        </label>
                        <label>
                            <span> comments </span>
                            <input type="password"
                                value={this.state.password}
                                onChange={e => this.setState({ password: e.target.value })}
                            />
                        </label>
                        <button class="submit" type="button" onClick={this.handleSubmit}> Submit </button>
                        <p class="forgot-pass"> Forgot Password ? </p>
                        <p>{this.state.responseToPost}</p>

                    </form>
                    <div class="sub-cont">
                        <div class="img">
                            <div class="img-text m-up">
                                <h2>One of us?</h2>
                                <p>If yoy already has an account, just sign in. We've missed you! </p>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        )
    }
}
// document.getElementById('.img-btn').addEventListener('click', function()
// 	{
// 		document.getElementById('.cont').classList.toggle('s-signup')
// 	}
// );

export default Insurance
